" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Apical two chamber view of the left ventricle and mitral valve",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 373px; height: 413px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Mitral annular calcification (MAC) is seen as a bright echodense&nbsp;structure&nbsp;along the posterior mitral valve annulus as calcium is a dense ultrasound reflector. In the lower portion of the image, there is absence of ultrasound penetration in the far field distal to the MAC&nbsp;due to acoustic shadowing. With severe acoustic shadowing, the left atrium may be obscured, making it difficult to identify and quantify mitral regurgitation.",
"    <div class=\"footnotes\">",
"    </div>",
