"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     100 mg (48): $392.40",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Tablet, orally-disintegrating",
"     </b>",
"     (FazaClo Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     12.5 mg (100): $247.50",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     25 mg (48): $159.88",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     100 mg (48): $436.00",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     150 mg (48): $517.73",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     200 mg (48): $690.30",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Tablets",
"     </b>",
"     (CloZAPine Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     25 mg (100): $131.94",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     50 mg (100): $165.00",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     100 mg (100): $341.86",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     200 mg (100): $632.32",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      Tablets",
"     </b>",
"     (Clozaril Oral)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     25 mg (100): $417.94",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;text-align:justify;\">",
"     100 mg (100): $1082.89",
"    </p>",
"   </div>",
"   <div class=\"block mop drugH1Div\" id=\"F153925\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Monitoring Parameters",
"    </span>",
"    <p style=\"text-indent:0em;margin-left:0em;margin-right:0em;margin-top:0em;text-align:justify;display:inline\">",
"     <b>",
"      Note:",
"     </b>",
"     The Canadian labeling recommends initiating treatment in an inpatient setting or an outpatient setting with medical supervision and monitoring of vital signs for at least 6-8 hours after the first few doses.",
"    </p>",
"    <p style=\"text-indent:0em;margin-left:0em;margin-right:0em;margin-top:2em;text-align:justify;\">",
"     Mental status, ECG, WBC (see below), vital signs, fasting lipid profile and fasting blood glucose/Hgb A",
"     <sub>",
"      1c",
"     </sub>",
"     (prior to treatment, at 3 months, then annually; liver function tests; BMI, personal/family history of obesity; waist circumference (weight should be assessed prior to treatment, at 4 weeks, 8 weeks, 12 weeks, and then at quarterly intervals. Consider titrating to a different antipsychotic agent for a weight gain &ge;5% of the initial weight); blood pressure; abnormal involuntary movement scale (AIMS).",
"    </p>",
"    <p style=\"text-indent:0em;margin-top:2em;text-align:justify;\">",
"     WBC and ANC should be obtained at baseline and at least weekly for the first 6 months (26 weeks) of continuous treatment. If counts remain acceptable (WBC &ge;3500/mm",
"     <sup>",
"      3",
"     </sup>",
"     , ANC &ge;2000/mm",
"     <sup>",
"      3",
"     </sup>",
"     ) during this time period, then they may be monitored every other week for the next 6 months (26 weeks). If WBC/ANC continue to remain within these acceptable limits after the second 6 months (26 weeks) of therapy, monitoring can be decreased to every 4 weeks. If clozapine is discontinued, a weekly WBC should be conducted for an additional 4 weeks or until WBC is &ge;3500/mm",
"     <sup>",
"      3",
"     </sup>",
"     and ANC is &ge;2000/mm",
"     <sup>",
"      3",
"     </sup>",
"     . If clozapine therapy is interrupted due to moderate leukopenia, weekly WBC/ANC monitoring is required for 12 months in patients restarted on clozapine treatment. (",
"     <b>",
"      Note:",
"     </b>",
"     When therapy is interrupted for &gt;3 days, the Canadian labeling recommends weekly hematologic testing for an additional 6 weeks). If therapy is interrupted for reasons other than leukopenia/granulocytopenia, the 6-month time period for initiation of biweekly WBCs may need to be reset.",
"     <b>",
"      This determination depends upon the treatment duration, the length of the break in therapy, and whether or not an abnormal blood event occurred.",
"     </b>",
"    </p>",
"    <p style=\"text-indent:0em;margin-left:0em;margin-right:0em;margin-top:2em;text-align:justify;\">",
"     Consult manufacturer prescribing information for determination of appropriate WBC/ANC monitoring interval.",
"    </p>",
"   </div>",
