"      Lapenax (AR);",
"     </li>",
"     <li>",
"      Leponex (AE, AT, BE, BG, BH, BR, CH, CN, CO, CY, CZ, DE, DK, EE, EG, ES, FI, FR, GR, HN, IL, IQ, IR, IT, JO, KW, LB, LY, MX, NL, NO, OM, PE, PH, PL, PT, QA, SA, SE, SY, TR, UY, VE, YE);",
"     </li>",
