"      Refraxol (PE);",
"     </li>",
"     <li>",
"      Sizopin (IN);",
"     </li>",
"     <li>",
"      Sizoril (ID);",
"     </li>",
"     <li>",
"      Syclop (PH);",
"     </li>",
"     <li>",
"      Tanyl (CO);",
"     </li>",
"     <li>",
"      Zapen (CO);",
"     </li>",
"     <li>",
"      Zapine (TW);",
"     </li>",
"     <li>",
"      Ziproc (PH)",
