"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F153915\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Clozapine (dibenzodiazepine antipsychotic) exhibits weak antagonism of  D",
"     <sub>",
"      1",
"     </sub>",
"     , D",
"     <sub>",
"      2",
"     </sub>",
"     , D",
"     <sub>",
"      3",
"     </sub>",
"     , and D",
"     <sub>",
"      5",
"     </sub>",
"     dopamine receptor subtypes, but shows high affinity for D",
"     <sub>",
"      4",
"     </sub>",
"     ; in addition, it blocks the serotonin (5-HT",
"     <sub>",
"      2",
"     </sub>",
"     ), alpha-adrenergic, histamine H",
"     <sub>",
"      1",
"     </sub>",
"     , and cholinergic receptors",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F153934\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: 97% to serum proteins",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Extensively hepatic; forms metabolites with limited or no activity",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: 50% to 60% (not affected by food)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: Steady state: 12 hours (range: 4-66 hours)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak: 2.5 hours (range: 1-6 hours)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (~50%) and feces (30%) with trace amounts of unchanged drug",
"    </p>",
"   </div>",
