var title_f34_21_35164="ADA lipid guideline";
var content_f34_21_35164=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F75008&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F75008&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Management of dyslipidemia in children and adolescents with diabetes",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Screening",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Type 1",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Obtain lipid profile at diagnosis (after glycemic control is well established). If normal, repeat every 5 years.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Begin at age 10 years (or onset of puberty, if earlier)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        &bull; Begin prior to age 10 years if there is a family history of early cardiovascular disease, or if child is overweight or obese",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Type 2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Obtain lipid profile at diagnosis (after glycemic control is well established). If normal, repeat every 2 years.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Monitoring",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        If lipids are abnormal, annual monitoring is recommended",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        If LDL cholesterol values are within the accepted risk levels (&lt;100 mg/dL [2.6 mmoL/L]), a lipid profile should be repeated every 5 years for type 1 diabetes, or every 2 years for type 2 diabetes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Goals",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        LDL &lt;100 mg/dL",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        HDL &gt;35 mg/dL",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Triglycerides &lt;150 mg/dL",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Treatment strategies",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Diet: Step 2 AHA diet, aimed to decrease intake of saturated fat",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Maximize glycemic control",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Weight reduction, if indicated",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Medications",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Indications: Age &gt;10 years AND LDL &ge;160 mg/dL, OR LDL 130-159 mg/dL if other risk factors for CVD",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Statins &plusmn; resins",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Fibric acid derivatives if triglycerides &gt;1000 mg/dL",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\">",
"        Manage other CVD risk factors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Blood pressure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Tobacco",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Obesity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Inactivity",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     LDL: low-density lipoprotein; HDL: high-density lipoprotein; CVD: cardiovascular disease; AHA: American Heart Association.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: American Diabetes Association. Management of dyslipidemia in children and adolescents with diabetes. Diabetes Care 2003; 26:2194. Copyright &copy; 2003 American Diabetes Association. Modified based on 2008 ADA guidelines.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
